gOP(){return"The manuscript was brought to Florence by an \xe9migr\xe9 scholar after the fall of Constantinople in 1453, and then transported to France in the 16th century by Catherine de' Medici. The oldest biblical text was first noticed by Pierre Allix, a Protestant pastor, in the early 18th century. Various scholars occasionally made excerpts from the manuscript, but Tischendorf was the first to read it in its entirety in 1845."},
