gNx(){return"\u041f\u0430\u043f\u0438\u0440\u0443\u0441 85 \u0441\u043e\u0441\u0442\u043e\u0438\u0442 \u0438\u0437 \u0442\u0440\u0435\u0445 \u0444\u0440\u0430\u0433\u043c\u0435\u043d\u0442\u043e\u0432 \u043f\u0430\u043f\u0438\u0440\u0443\u0441\u043d\u043e\u0433\u043e \u043b\u0438\u0441\u0442\u0430, \u043f\u0440\u0438\u0447\u0435\u043c \u0441\u0430\u043c\u044b\u0439 \u0431\u043e\u043b\u044c\u0448\u043e\u0439 \u0444\u0440\u0430\u0433\u043c\u0435\u043d\u0442 \u0438\u043c\u0435\u0435\u0442 \u0440\u0430\u0437\u043c\u0435\u0440 \u043f\u0440\u0438\u043c\u0435\u0440\u043d\u043e 4 \xd7 7 \u0441\u043c. \u0424\u0440\u0430\u0433\u043c\u0435\u043d\u0442\u044b \u0441\u043e\u0434\u0435\u0440\u0436\u0430\u0442 \u0442\u0435\u043a\u0441\u0442 \u0438\u0437 \u043a\u043d\u0438\u0433\u0438 \u041e\u0442\u043a\u0440\u043e\u0432\u0435\u043d\u0438\u044f, \u043d\u0430\u043f\u0438\u0441\u0430\u043d\u043d\u044b\u0439 \u0441 \u043e\u0431\u0435\u0438\u0445 \u0441\u0442\u043e\u0440\u043e\u043d."},
