gNu(){return"\u0412 \u043d\u0430\u0441\u0442\u043e\u044f\u0449\u0435\u0435 \u0432\u0440\u0435\u043c\u044f \u041f\u0430\u043f\u0438\u0440\u0443\u0441 85 \u0445\u0440\u0430\u043d\u0438\u0442\u0441\u044f \u0432 \u041d\u0430\u0446\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u043e\u0439 \u0430\u043a\u0430\u0434\u0435\u043c\u0438\u0447\u0435\u0441\u043a\u043e\u0439 \u0431\u0438\u0431\u043b\u0438\u043e\u0442\u0435\u043a\u0435 \u0432 \u0421\u0442\u0440\u0430\u0441\u0431\u0443\u0440\u0433\u0435, \u0424\u0440\u0430\u043d\u0446\u0438\u044f."},
