gNF(){return"\u0414\u0430\u043d\u043d\u044b\u0439 \u043f\u0435\u0440\u0432\u043e\u0438\u0441\u0442\u043e\u0447\u043d\u0438\u043a \u043d\u0430\u043f\u0438\u0441\u0430\u043d \u043d\u0430 \u043f\u0430\u043f\u0438\u0440\u0443\u0441\u0435 \u0438 \u043f\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u043b\u044f\u0435\u0442 \u0441\u043e\u0431\u043e\u0439 \u0444\u0440\u0430\u0433\u043c\u0435\u043d\u0442 \u0440\u0430\u0437\u043c\u0435\u0440\u043e\u043c \u043f\u0440\u0438\u043c\u0435\u0440\u043d\u043e 7 \xd7 13 \u0441\u043c, \u043a\u043e\u0442\u043e\u0440\u044b\u0439 \u0438\u0437\u043d\u0430\u0447\u0430\u043b\u044c\u043d\u043e \u0432\u0445\u043e\u0434\u0438\u043b \u0432 \u0441\u043e\u0441\u0442\u0430\u0432 \u0441\u0432\u0438\u0442\u043a\u0430 \u0441 \u0442\u0435\u043a\u0441\u0442\u043e\u043c \u041e\u0442\u043a\u0440\u043e\u0432\u0435\u043d\u0438\u044f."},
gNG(){return"\u0421\u043e\u0445\u0440\u0430\u043d\u0438\u0432\u0448\u0438\u0439\u0441\u044f \u0442\u0435\u043a\u0441\u0442 \u041e\u0442\u043a\u0440\u043e\u0432\u0435\u043d\u0438\u044f \u043d\u0430\u0445\u043e\u0434\u0438\u0442\u0441\u044f \u0432 \u0444\u0440\u0430\u0433\u043c\u0435\u043d\u0442\u0430\u0440\u043d\u043e\u043c \u0441\u043e\u0441\u0442\u043e\u044f\u043d\u0438\u0438. \u041f\u0438\u0441\u044c\u043c\u043e \u0432\u044b\u043f\u043e\u043b\u043d\u0435\u043d\u043e \u043a\u0440\u0443\u043f\u043d\u044b\u043c \u0438 \u0445\u043e\u0440\u043e\u0448\u043e \u0441\u0444\u043e\u0440\u043c\u0438\u0440\u043e\u0432\u0430\u043d\u043d\u044b\u043c \u0443\u043d\u0446\u0438\u0430\u043b\u044c\u043d\u044b\u043c \u0448\u0440\u0438\u0444\u0442\u043e\u043c. \u0424\u0440\u0430\u0433\u043c\u0435\u043d\u0442 \u0431\u044b\u043b \u0447\u0430\u0441\u0442\u044c\u044e \u0441\u0432\u0438\u0442\u043a\u0430. \u0411\u0438\u0431\u043b\u0435\u0439\u0441\u043a\u0438\u0439 \u0442\u0435\u043a\u0441\u0442 \u0440\u0430\u0441\u043f\u043e\u043b\u043e\u0436\u0435\u043d \u043d\u0430 \u043e\u0431\u043e\u0440\u043e\u0442\u043d\u043e\u0439 \u0441\u0442\u043e\u0440\u043e\u043d\u0435, \u0430 \u043d\u0430 \u043b\u0438\u0446\u0435\u0432\u043e\u0439 \u0441\u0442\u043e\u0440\u043e\u043d\u0435 \u0441\u043e\u0434\u0435\u0440\u0436\u0438\u0442\u0441\u044f \u0434\u0440\u0443\u0433\u043e\u0439 \u0434\u043e\u043a\u0443\u043c\u0435\u043d\u0442\u0430\u043b\u044c\u043d\u044b\u0439 \u0442\u0435\u043a\u0441\u0442, \u0434\u0430\u0442\u0438\u0440\u0443\u0435\u043c\u044b\u0439 \u043a\u043e\u043d\u0446\u043e\u043c I \u0432\u0435\u043a\u0430 \u0438\u043b\u0438 \u043d\u0430\u0447\u0430\u043b\u043e\u043c II \u0432\u0435\u043a\u0430."},
