gPR(){return"\u0423\u043d\u0446\u0438\u0430\u043b \u043d\u0430\u043f\u0438\u0441\u0430\u043d \u043d\u0430 \u043f\u0435\u0440\u0433\u0430\u043c\u0435\u043d\u0442\u0435 (vellum). \u041e\u043d \u0441\u043e\u0441\u0442\u043e\u0438\u0442 \u0438\u0437 92 \u0444\u043e\u043b\u0438\u043e, \u043a\u0430\u0436\u0434\u043e\u0435 \u0438\u0437 \u043a\u043e\u0442\u043e\u0440\u044b\u0445 \u0438\u043c\u0435\u0435\u0442 \u0440\u0430\u0437\u043c\u0435\u0440 \u043f\u0440\u0438\u043c\u0435\u0440\u043d\u043e 23 \xd7 18 \u0441\u043c. \u0420\u0443\u043a\u043e\u043f\u0438\u0441\u044c \u0441\u043e\u0434\u0435\u0440\u0436\u0438\u0442 \u043d\u0435\u043f\u043e\u043b\u043d\u044b\u0439 \u0442\u0435\u043a\u0441\u0442 \u041e\u0442\u043a\u0440\u043e\u0432\u0435\u043d\u0438\u044f \u0432\u043c\u0435\u0441\u0442\u0435 \u0441 \u043a\u043e\u043c\u043c\u0435\u043d\u0442\u0430\u0440\u0438\u0435\u043c \u0410\u043d\u0434\u0440\u0435\u044f \u041a\u0435\u0441\u0430\u0440\u0438\u0439\u0441\u043a\u043e\u0433\u043e."},
